- Entrevistas:
-Governador Ibaneis Rocha;
-Ministro da Justiça e Segurança Pública, Ricardo Lewandowski;
-Ministra da Saúde, Nísia Trindade;
-Governador de Mato Grosso, Mauro Mendes; 
-Governador do Espírito Santo, Renato Casagrande;

A Faria Lima venceu! Os campeões nacionais exigiram e  obedeceu. 
-ninguém mexe nos marajás de Brasília - principalmente nos do judiciário;
-ninguém mexe nos lucros exorbitantes dos bancos;

Bora cortar da educação, segurança pública, saúde e aumentar impostos, claro.
